    <p class="w-full md:w-[600px] lg:w-[700px] pt-2 text-center lg:text-center text-6.25 lg:text-7.5 text-rojo">
      Calidad-precio y la capacidad de adaptarse a cada cliente han
      consolidado a esta empresa como un proveedor de confianza para
      distribuidores especializados de toda España.
    </p>
